import React from 'react';
import FeedBackItem from './FeedBackItem';

  
const FeedbackList = (items) => {
  return (
      <>
      <ul className='feedbackList'>
  { props.items.map((item) => (
          <FeedBackItem 
          key = {item.id}
          rating = {item.rating}
          text = {item.text}
          />

      ))}
      </ul>
      </>
  )
};

export default FeedbackList;
